import React from "react";
import VideojuegoLista from "../Videojuego/VideojuegoLista";

const CatalogoItem = () => {
    return(
        <div className="col-md-4 mb-4">
            <VideojuegoLista key={videojuego.id} videojuego={videojuego} />
        </div>
    );
};

export default CatalogoItem;
